import React, { Component } from "react";
import "../css/Palette.css";

class Palette extends Component {
  render() {
    const { id, color } = this.props;
    console.log(color);
    return (
      <div style={{ background: color }} className="colorBox" key={id}></div>
    );
  }
}
export default Palette;
